import Phaser from '../lib/Phaser.js'

export default class Preload extends Phaser.Scene{

    platform;
    counter = 0;

    constructor()
    {
        super('preload')
    }

    preload()
    {
        this.platform = this;
        this.counter = 0;
    }

    create()
    {
        const background_imageData = "data:image/png;base64,"
        const blurredBackground_imageData = "data:image/png;base64,"
        const cabIcon_imageData = "data:image/png;base64,"
        const congrateMsg_imageData = "data:image/png;base64,"
        const diary_imageData = "data:image/png;base64,"
        const diaryGlow_imageData = "data:image/png;base64,"
        const headphones_imageData = "data:image/png;base64,"
        const headphoneGlow_imageData = "data:image/png;base64,"
        const keyHolder_imageData = "data:image/png;base64,"
        const keys_imageData = "data:image/png;base64,"
        const keysGlow_imageData = "data:image/png;base64,"
        const laptop_imageData = "data:image/png;base64,"
        const laptopGlow_imageData = "data:image/png;base64,"
        const lines_imageData = "data:image/png;base64,"
        const linesCongrate_imageData = "data:image/png;base64,"
        const locationIcon_imageData = "data:image/png;base64,"
        const logo_imageData = "data:image/png;base64,"
        const lunch_imageData = "data:image/png;base64,"
        const lunchGlow_imageData = "data:image/png;base64,"
        const mask_imageData = "data:image/png;base64,"
        const maskGlow_imageData = "data:image/png;base64,"
        const openingMsg_imageData = "data:image/png;base64,"
        const phone_imageData = "data:image/png;base64,"
        const phoneGlow_imageData = "data:image/png;base64,"
        const sanitizer_imageData = "data:image/png;base64,"
        const sanitizerGlow_imageData = "data:image/png;base64,"
        const shades_imageData = "data:image/png;base64,"
        const shadesGlow_imageData = "data:image/png;base64,"
        const sorryMsg_imageData = "data:image/png;base64,"
        const tryagainBlack_imageData = "data:image/png;base64,"
        const tryagainGreen_imageData = "data:image/png;base64,"
        const TTSblack_imageData = "data:image/png;base64,"
        const TTSgreen_imageData = "data:image/png;base64,"
        const wallet_imageData = "data:image/png;base64,"
        const walletGlow_imageData = "data:image/png;base64,"

        const applaude_audioData = "data:audio/mpeg;base64,"
        const tap_audioData = "data:audio/mpeg;base64,"
        const tryAgain_audioData = "data:audio/mpeg;base64,"


        this.platform.textures.addBase64('background', background_imageData)
        this.platform.textures.addBase64('blurredBackground', blurredBackground_imageData)
        this.platform.textures.addBase64('diary', diary_imageData)
        this.platform.textures.addBase64('diaryGlow', diaryGlow_imageData)
        this.platform.textures.addBase64('headphones', headphones_imageData)
        this.platform.textures.addBase64('headphonesGlow', headphoneGlow_imageData)
        this.platform.textures.addBase64('keyHolder', keyHolder_imageData)
        this.platform.textures.addBase64('keys', keys_imageData)
        this.platform.textures.addBase64('keysGlow', keysGlow_imageData)
        this.platform.textures.addBase64('laptop', laptop_imageData)
        this.platform.textures.addBase64('laptopGlow', laptopGlow_imageData)
        this.platform.textures.addBase64('lunch', lunch_imageData)
        this.platform.textures.addBase64('lunchGlow', lunchGlow_imageData)
        this.platform.textures.addBase64('mask', mask_imageData)
        this.platform.textures.addBase64('maskGlow', maskGlow_imageData)
        this.platform.textures.addBase64('phone', phone_imageData)
        this.platform.textures.addBase64('phoneGlow', phoneGlow_imageData)
        this.platform.textures.addBase64('sanitizer', sanitizer_imageData)
        this.platform.textures.addBase64('sanitizerGlow', sanitizerGlow_imageData)
        this.platform.textures.addBase64('shades', shades_imageData)
        this.platform.textures.addBase64('shadesGlow', shadesGlow_imageData)
        this.platform.textures.addBase64('wallet', wallet_imageData)
        this.platform.textures.addBase64('walletGlow', walletGlow_imageData)
        this.platform.textures.addBase64('logo', logo_imageData)
        this.platform.textures.addBase64('openingMsg', openingMsg_imageData)
        this.platform.textures.addBase64('TTSblack', TTSblack_imageData)
        this.platform.textures.addBase64('TTSgreen', TTSgreen_imageData)
        this.platform.textures.addBase64('sorryMsg', sorryMsg_imageData)
        this.platform.textures.addBase64('tryagainBlack', tryagainBlack_imageData)
        this.platform.textures.addBase64('tryagainGreen', tryagainGreen_imageData)
        this.platform.textures.addBase64('wonImage', congrateMsg_imageData)
        this.platform.textures.addBase64('cab', cabIcon_imageData)
        this.platform.textures.addBase64('locationPin', locationIcon_imageData)
        this.platform.textures.addBase64('lines', lines_imageData)
        this.platform.textures.addBase64('linesCongrate', linesCongrate_imageData)

        this.platform.sound.decodeAudio('congratsSound', applaude_audioData)
        this.platform.sound.decodeAudio('tapSound', tap_audioData)
        this.platform.sound.decodeAudio('tryAgainSound', tryAgain_audioData)
        
        this.platform.textures.on('onload', function() {
            this.counter += 1;
            console.log(this.counter)
        }, this);

        // Timer check when all based64 assets have been loaded
        this.platform.customTimer = this.platform.time.addEvent({ delay: 500, callback: function callback() {
            
            // Adjust counter maximum as you ecpect. For now just one based64 assets need to be loaded only
            if (this.counter === 35) {
            
                // Destroy timer to save memory
                this.platform.customTimer.remove(false);

                this.scene.start('splash-screen')
            }

        
        }, callbackScope: this.platform, loop: true}, this);
    }
}